import "./section-style.css";
import screen1 from "../../image/screen/screen-1.png";
import screen2 from "../../image/screen/screen-2.png";
import screen3 from "../../image/screen/screen-3.png";
import { steps, feature } from "./context";

export default function Section() {
  const img = ["screen1", "screen2", "screen3"];
  return (
    <>
      <div className="hero-section">
        <div className="hero">
          <h1 className="heading-primary">
            <span className="heading-main">Poop Prom</span>
            <span className="heading-sub">Your best toilet finder</span>
          </h1>
        </div>
      </div>
      <article>
        <h2>Some additional content</h2>
        <p>
          The rest of the page content continues below the hero. You can use the
          hero at the top of your page, e.g. the home page. A hero is great to
          display a high quality picture together with tasty title.
        </p>
        <p>
          Ad donec tincidunt torquent ultricies convallis sodales faucibus
          magna, fringilla lorem blandit sollicitudin donec faucibus curae orci
          molestie, et proin curae aliquet venenatis ligula amet vivamus orci
          varius arcu.
        </p>
        <p>
          Laoreet fusce condimentum venenatis quisque imperdiet ornare cras
          faucibus convallis, pharetra habitasse elementum ut bibendum per
          sociosqu phasellus etiam, velit faucibus integer torquent leo
          elementum maecenas netus.
        </p>
      </article>
      <section className="section-how" id="how">
        <div className="how-container">
          <span className="subheading">How it works</span>
          <h2 className="heading-secondary">
            Your daily dose of health in 3 simple steps
          </h2>
        </div>

        <div className="how-container grid grid--2--cols grid--center--v">
          {/* <!-- Step 01 --> */}
          <div className="step-text-box">
            <p className="step-number">01</p>
            <h3 className="heading-tertiary">
              Tell us what you like (and what not)
            </h3>
            <p className="step-description">
              Never again waste time thinking about what to eat! Omnifood AI
              will create a 100% personalized weekly meal plan just for you. It
              makes sure you get all the nutrients and vitamins you need, no
              matter what diet you follow!
            </p>
          </div>

          <div className="step-img-box">
            <img
              src={screen1}
              className="step-img"
              alt="iPhone app preferences selection screen"
            />
          </div>
        </div>

        <Accordion data={steps} order={img}/>
      </section>
    </>
  );
}

function Accordion({ data,order }) {
  return (
    <div className="how-container grid grid--2--cols grid--center--v">
      {data.map((el, i) => (
        <AccordionItem title={el.title} text={el.text} num={i} key={el.title} />

      ))}
    </div>
  );
}

function AccordionItem({ num, title, text }) {
  return (
    <div className="step-text-box">
      <p className="step-number">{num < 9 ? `0${num + 1}` : num + 1}</p>
      <h3 className="heading-tertiary">{title}</h3>
      <p className="step-description">{text}</p>
    </div>
  );
}

function StepImage({ num, title, text }) {
  return (
    <div className="step-text-box">
      <p className="step-number">{num < 9 ? `0${num + 1}` : num + 1}</p>
      <h3 className="heading-tertiary">{title}</h3>
      <p className="step-description">{text}</p>
    </div>
  );
}
